import React from 'react'
function NameList(){
    const name = ['karthik','Rajesh','Joga','Girish']
    return(
        <div>
            <h2>{name[0]}</h2>
            <h2>{name[1]}</h2>
            <h2>{name[2]}</h2>
            <h2>{name[3]}</h2>
        </div>
    )
}
export default NameList
